function insertLingvoIcon(element) {
	const classNames = Array.from(element.classList)
	const iconStyle = classNames.find(className => className.startsWith('li-'))
	const iconName = classNames.find(className => className !== iconStyle)

	if (iconStyle && iconName) {
		const style = iconStyle.substring(3)
		const name = iconName

		if (lingvoIcons[name] && lingvoIcons[name][style]) {
			element.innerHTML = lingvoIcons[name][style]
		} else {
			console.error(`Иконка с именем "${name}" и стилем "${style}" не найдена.`)
		}
	} else {
		console.error('Стиль или имя иконки не указаны в классах элемента.')
	}
}

function initLingvoIcons() {
	const iconElements = document.querySelectorAll(
		'.li-solid, .li-regular, .li-brand'
	)

	iconElements.forEach(iconElement => {
		insertLingvoIcon(iconElement)
	})
}

document.addEventListener('DOMContentLoaded', initLingvoIcons)

